import React from "react";
import {
  BrowserRouter as Router,
  Route,
  NavLink,
  Routes,
  useHistory,
} from "react-router-dom";

import { CustomErrorState } from "../guides/CustomErrorState";
import { CustomLoadingState } from "../guides/CustomLoadingState";
import { CustomEmptyState } from "../guides/CustomEmptyState";

const Home = () => {
  return (
    <Router>
      <NavLink to="/" className="nav-link">
        Loading
      </NavLink>
      <NavLink to="/empty" className="nav-link">
        Empty
      </NavLink>
      <NavLink to="/error" className="nav-link">
        Error
      </NavLink>

      <Routes>
        <Route path="/" component={<CustomLoadingState />} />
        <Route exact path="/empty" component={<CustomEmptyState />} />
        <Route exact path="/error" component={<CustomErrorState />} />
      </Routes>
    </Router>
  );
};

export { Home };
